-- ----------------------------
--  Table structure for `HelpCategory`
-- ----------------------------
DROP TABLE IF EXISTS `HelpCategory`;
CREATE TABLE `HelpCategory` (
  `Id` char(36) NOT NULL,
  `CategoryName` varchar(255) DEFAULT NULL COMMENT '名称',
  `Url` varchar(255) DEFAULT NULL COMMENT '访问地址',
  `Title` varchar(255) DEFAULT NULL COMMENT '标题',
  `ShortDescrption` text COMMENT '简单说明',
  `Descrption` longtext COMMENT '详细说明',
  `ICON` varchar(50) DEFAULT NULL COMMENT '图标',
  `DataSort` int(11) DEFAULT NULL,
