  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `HelpContent`
-- ----------------------------
DROP TABLE IF EXISTS `HelpContent`;
CREATE TABLE `HelpContent` (
  `Id` char(36) NOT NULL,
  `Name` varchar(255) DEFAULT NULL COMMENT '名称',
  `Url` varchar(255) DEFAULT NULL COMMENT '访问地址',
  `Title` varchar(255) DEFAULT NULL COMMENT '标题',
  `ShortDescrption` text COMMENT '简单说明',
  `Descrption` longtext COMMENT '详细说明',
  `ICON` varchar(50) DEFAULT NULL COMMENT '图标',
  `DataSort` int(11) DEFAULT NULL,
  `CreateTime` datetime DEFAULT NULL,
  `CategoryId` char(36) DEFAULT NULL COMMENT '类别ID',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `Hr_Department`
-- ----------------------------
DROP TABLE IF EXISTS `Hr_Department`;
CREATE TABLE `Hr_Department` (
  `Id` char(36) NOT NULL COMMENT '编号',
  `Name` varchar(255) DEFAULT NULL COMMENT '名称',
  `Description` text COMMENT '描述',
  `DeptmentType` int(11) DEFAULT NULL COMMENT '部门类型',
