  `DelFlag` tinyint(4) DEFAULT NULL COMMENT ' 删除标记 true 表示已经删除',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='部门管理';

-- ----------------------------
--  Table structure for `Hr_DepartmentPosition`
-- ----------------------------
DROP TABLE IF EXISTS `Hr_DepartmentPosition`;
CREATE TABLE `Hr_DepartmentPosition` (
  `Id` char(36) NOT NULL,
  `PositionId` char(36) DEFAULT NULL COMMENT '岗位ID',
  `DepartmentId` char(36) DEFAULT NULL COMMENT '部门ID',
