  `LastUpdateTime` datetime DEFAULT NULL COMMENT '最后更新时间',
  `LastUpdateUserId` char(36) DEFAULT NULL COMMENT '最后更新人',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='部门岗位关联表';

-- ----------------------------
--  Table structure for `Hr_Employee`
-- ----------------------------
DROP TABLE IF EXISTS `Hr_Employee`;
CREATE TABLE `Hr_Employee` (
  `Id` char(36) NOT NULL,
  `RealName` varchar(255) DEFAULT NULL COMMENT '名称',
