-- ----------------------------
--  Table structure for `Sys_Config`
-- ----------------------------
DROP TABLE IF EXISTS `Sys_Config`;
CREATE TABLE `Sys_Config` (
  `Id` char(36) NOT NULL COMMENT '编号',
  `ModuleGroupId` char(36) DEFAULT NULL COMMENT '模块组ID',
  `Name` varchar(255) DEFAULT NULL COMMENT '名称',
  `Style` int(11) NOT NULL COMMENT '0 默认 1 JSON配置',
  `CanAddOrDelete` tinyint(4) NOT NULL COMMENT '是否可删除（运行中可添加删除的配置）',
  `CustomCategoryId` char(36) DEFAULT NULL COMMENT '自定义分类ID',
  `JsonData` text COMMENT '配置内容',
  `Description` varchar(255) DEFAULT NULL COMMENT '描述',
  `GroupName` varchar(255) DEFAULT NULL COMMENT '配置分组名称',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='常用配置';

-- ----------------------------
--  Table structure for `Sys_ConfigAttachment`
-- ----------------------------
DROP TABLE IF EXISTS `Sys_ConfigAttachment`;
CREATE TABLE `Sys_ConfigAttachment` (
  `Id` char(36) NOT NULL,
  `Description` varchar(255) DEFAULT NULL,
  `Name` varchar(255) DEFAULT NULL,
  `Code` varchar(255) DEFAULT NULL,
  `FileExtensions` varchar(255) DEFAULT NULL COMMENT '文件扩展名列表',
  `MaxSize` varchar(255) DEFAULT NULL COMMENT '最大文件大小',
  `SingleOrMulti` tinyint(4) DEFAULT NULL COMMENT '单一或多个',
  `DataSort` int(11) DEFAULT NULL COMMENT '排序',
  `VisitLevel` int(11) DEFAULT NULL COMMENT '层级',
  `VisitPath` varchar(255) DEFAULT NULL COMMENT '路径',
  `RootId` char(36) DEFAULT NULL COMMENT '跟节点',
  `ParentId` char(36) DEFAULT NULL COMMENT '父分组ID',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='常用附件配置';

-- ----------------------------
--  Table structure for `Sys_ConfigCategory`
-- ----------------------------
DROP TABLE IF EXISTS `Sys_ConfigCategory`;
CREATE TABLE `Sys_ConfigCategory` (
  `Id` char(36) NOT NULL,
  `Name` varchar(255) DEFAULT NULL COMMENT '名称',
  `Description` varchar(255) DEFAULT NULL COMMENT '描述',
  `DataSort` int(11) NOT NULL COMMENT '排序',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='配置项分类';

-- ----------------------------
--  Table structure for `Sys_ConfigItem`
-- ----------------------------
DROP TABLE IF EXISTS `Sys_ConfigItem`;
CREATE TABLE `Sys_ConfigItem` (
  `Id` char(36) NOT NULL COMMENT '编号',
  `Name` varchar(255) DEFAULT NULL COMMENT '配置项名称',
  `DisplayName` varchar(255) DEFAULT NULL COMMENT '配置显示名称',
  `Value` text COMMENT '配置值',
  `ItemType` varchar(255) DEFAULT NULL COMMENT '数据类型 0：文本框  1整数控件 2  时间控件 3:bool 4：浮点数  101：CheckBox  102：下拉列表 103：树',
  `DataSourseType` varchar(255) DEFAULT NULL COMMENT '数据来源类型 0 录入以,分割的字符串 1 数据字典 99:JSON格式录入',
  `DataSourseJsonData` text COMMENT 'JSON格式数据源，来源于数据字典的下拉列表或树的内容格式为{''DictionaryCode'':''Value''} ，其它为契约规定的JSON格式数据',
  `DataSort` int(11) NOT NULL COMMENT '排序',
  `CustomField` text COMMENT '自定义属性',
  `DataPrecision` int(11) DEFAULT NULL COMMENT '数字精度',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='配置项';

-- ----------------------------
--  Table structure for `Sys_Dictionary`
-- ----------------------------
DROP TABLE IF EXISTS `Sys_Dictionary`;
CREATE TABLE `Sys_Dictionary` (
  `Id` char(36) NOT NULL,
  `Description` varchar(255) DEFAULT NULL,
  `RootId` char(36) DEFAULT NULL COMMENT '跟ID',
  `ParentId` char(36) DEFAULT NULL COMMENT '父ID',
  `DataSort` int(11) DEFAULT NULL COMMENT '排序',
  `DelFlag` tinyint(4) DEFAULT NULL COMMENT ' 删除标记 true 表示已经删除',
  `VisitLevel` int(11) DEFAULT NULL COMMENT '访问层次',
  `VisitPath` text COMMENT '遍历路径',
  `Name` varchar(255) DEFAULT NULL COMMENT '名称',
  `ShortName` varchar(255) DEFAULT NULL COMMENT '简称',
  `Code` varchar(255) DEFAULT NULL COMMENT '代码',
  `RuleExpression` text COMMENT '规则表达式',
  `CustomField1` int(11) DEFAULT NULL COMMENT '自定义属性1',
  `CustomField2` varchar(255) DEFAULT NULL COMMENT '自定义属性2',
  `CustomField3` text COMMENT '自定义属性3',
  `HasChild` tinyint(4) DEFAULT NULL COMMENT '是否有孩子节点',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='数据字典';

