-- ----------------------------
--  Table structure for `Sys_EnterpriseQualification`
-- ----------------------------
DROP TABLE IF EXISTS `Sys_EnterpriseQualification`;
CREATE TABLE `Sys_EnterpriseQualification` (
  `Id` char(36) NOT NULL,
  `Description` varchar(255) DEFAULT NULL,
  `RootId` char(36) DEFAULT NULL COMMENT '跟ID',
  `ParentId` char(36) DEFAULT NULL COMMENT '父ID',
  `DataSort` int(11) DEFAULT NULL COMMENT '排序',
  `DelFlag` tinyint(4) DEFAULT NULL COMMENT ' 删除标记 true 表示已经删除',
  `VisitLevel` int(11) DEFAULT NULL COMMENT '访问层次',
  `VisitPath` text COMMENT '遍历路径',
  `Name` varchar(255) DEFAULT NULL COMMENT '名称',
  `ShortName` varchar(255) DEFAULT NULL COMMENT '简称',
  `Code` varchar(255) DEFAULT NULL COMMENT '代码',
  `RuleExpression` text COMMENT '规则表达式',
  `CustomField1` int(11) DEFAULT NULL COMMENT '自定义属性1',
  `CustomField2` varchar(255) DEFAULT NULL COMMENT '自定义属性2',
  `CustomField3` text COMMENT '自定义属性3',
  `HasChild` tinyint(4) DEFAULT NULL COMMENT '是否有孩子节点',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='企业资质';

