-- ----------------------------
--  Table structure for `Sys_LocalResource`
-- ----------------------------
DROP TABLE IF EXISTS `Sys_LocalResource`;
CREATE TABLE `Sys_LocalResource` (
  `Id` char(36) NOT NULL COMMENT '编号',
  `Name` varchar(255) DEFAULT NULL COMMENT '名称',
  `Description` varchar(255) DEFAULT NULL COMMENT '描述',
  `Content` longtext COMMENT '内容',
  `Code` varchar(255) DEFAULT NULL COMMENT '代码',
  `AttachmentSavePath` varchar(255) DEFAULT NULL COMMENT '附件保存路径',
  `RootId` char(36) DEFAULT NULL COMMENT '跟ID',
  `ParentId` char(36) DEFAULT NULL COMMENT '父ID',
  `VisitLevel` int(11) DEFAULT NULL COMMENT '访问层次',
  `VisitPath` text COMMENT '遍历路径',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='本地化资源';

-- ----------------------------
--  Table structure for `Sys_Log`
-- ----------------------------
DROP TABLE IF EXISTS `Sys_Log`;
CREATE TABLE `Sys_Log` (
  `Id` char(36) NOT NULL,
  `LogType` int(11) DEFAULT NULL COMMENT '日志类型',
  `Name` varchar(255) DEFAULT NULL COMMENT '日志名称',
  `ShortMessage` text COMMENT '简短描述',
  `FullMessage` text COMMENT '详细描述',
  `ReferrerUrl` varchar(255) DEFAULT NULL COMMENT '引用地址',
  `RequestUrl` varchar(255) DEFAULT NULL COMMENT '请求地址',
  `MAC` varchar(255) DEFAULT NULL COMMENT 'MAC地址',
  `IP` varchar(255) DEFAULT NULL COMMENT 'IP地址',
  `CreateTime` datetime DEFAULT NULL COMMENT '创建时间',
  `CreateUserId` char(36) DEFAULT NULL COMMENT '创建人',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统日志';

