DROP TABLE IF EXISTS `Sys_ModuleGroup`;
CREATE TABLE `Sys_ModuleGroup` (
  `Id` char(36) NOT NULL,
  `Description` varchar(255) DEFAULT NULL COMMENT '描述',
  `DisplayName` varchar(255) DEFAULT NULL COMMENT '显示名称',
  `EnglishName` varchar(255) DEFAULT NULL COMMENT '英文名称',
  `ImgUrl` varchar(255) DEFAULT NULL COMMENT '图标路径',
  `VisitLevel` int(11) DEFAULT NULL COMMENT '层级',
  `VisitPath` varchar(255) DEFAULT NULL COMMENT '路径',
  `RootId` char(36) DEFAULT NULL COMMENT '跟节点',
  `ParentId` char(36) DEFAULT NULL COMMENT '父分组ID',
  `DataSort` int(11) DEFAULT NULL COMMENT '排序',
  `DataStatus` int(11) DEFAULT NULL COMMENT '0:过期、无效的、已经关闭 1:有效、正在使用、已经开启 99:其它',
  `DelFlag` tinyint(4) DEFAULT NULL COMMENT ' 删除标记 true 表示已经删除',
  `CreateTime` datetime DEFAULT NULL COMMENT '创建时间',
  `CreateUserId` char(36) DEFAULT NULL COMMENT '创建人',
  `LastUpdateTime` datetime DEFAULT NULL COMMENT '最后更新时间',
  `LastUpdateUserId` char(36) DEFAULT NULL COMMENT '最后更新人',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统模块组';

