-- ----------------------------
--  Procedure structure for `up_Sys_GenerateModuleGroupPath`
-- ----------------------------
DROP PROCEDURE IF EXISTS `up_Sys_GenerateModuleGroupPath`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `up_Sys_GenerateModuleGroupPath`(IN parentId varchar(50), IN pathUnit int)
BEGIN
	DECLARE parentVistPath VARCHAR(1024);
	DECLARE	newPath VARCHAR(1024);
	DECLARE	curIndex INT;
	DECLARE	maxIndex INT;
	DECLARE	parentPathLength INT;
	DECLARE	result INT;
 
	SET parentVistPath =IFNULL((SELECT VisitPath FROM Sys_ModuleGroup WHERE Id= parentId LIMIT 0,1),'');
	SET curIndex =POWER(10,pathUnit-1);
	SET maxIndex =POWER(10,pathUnit)-1;
	SET parentPathLength =LENGTH(parentVistPath);   
	SET newPath =CONCAT(parentVistPath,curIndex);   

	#@curIndex 小于等于最大值
	WHILE(curIndex<=maxIndex AND EXISTS(SELECT * FROM Sys_ModuleGroup AS T 
			WHERE T.ParentId=parentId AND  (T.DelFlag=0 OR t.DelFlag IS NULL)  AND VisitPath=newPath))
	DO
		SET curIndex =curIndex+1;
		SET newPath = CONCAT(parentVistPath,curIndex);    
	END WHILE;
	#超出路径界限
	IF(curIndex>maxIndex)
	THEN
		SET newPath='';
		SET result =-1; 
	ELSE 
		SET result=0;
	END IF;
	SELECT newPath as NewPath; 
	SELECT result;
END
 ;;
delimiter ;

-- ----------------------------
--  Procedure structure for `up_Sys_GetModuleGroups`
-- ----------------------------
DROP PROCEDURE IF EXISTS `up_Sys_GetModuleGroups`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `up_Sys_GetModuleGroups`(IN UserId varchar(50), IN ParentGroupId varchar(50), IN Unit int, IN GroupLevel int, IN IsSupperAdmin bit)
Begin
	DECLARE SelectPathLength INT;
	SET SelectPathLength = Unit*GroupLevel; 
	#系统管理员
	IF IsSupperAdmin=1
	THEN 
		SELECT * FROM Sys_ModuleGroup AS MG 
		WHERE MG.DataStatus=1 AND MG.DelFlag=0 AND ParentId=ParentGroupId
			AND EXISTS( 
			#所有当前可以访问的模块列表
			SELECT 1 FROM Sys_Module AS M
			INNER JOIN Sys_ModuleGroup AS G ON M.GroupId=G.Id
			WHERE M.DelFlag=0 AND M.DataStatus=1 AND G.DelFlag=0 AND G.DataStatus=1 
				AND SUBSTRING(G.VisitPath,1,SelectPathLength) = MG.VisitPath	#待选择模块组过滤
			)
		ORDER BY VisitPath;  
	ELSE 
		 #店铺管理员的没有访问权限 
		 SELECT * FROM Sys_ModuleGroup AS MG 
		 WHERE MG.DataStatus=1 AND MG.DelFlag=0 AND ParentId=ParentGroupId
			AND EXISTS( 
				#所有当前可以访问的模块列表
				SELECT 1 FROM  Sys_ModuleRights AS R 
				INNER JOIN Sys_Module AS M ON R.ModuleId = M.Id
				INNER JOIN Sys_ModuleGroup AS G ON M.GroupId=G.Id  
				WHERE R.RightType=0 AND G.DelFlag=0 AND G.DataStatus=1 AND M.DelFlag=0 AND M.DataStatus=1 #有效性过滤（未删除且正在使用的）
					AND SUBSTRING(G.VisitPath,1,SelectPathLength) = MG.VisitPath #待选择模块组过滤
			
				UNION ALL
				#当前角色有的权限
				#有效性过滤（要求未删除且正在使用的才能计算）
				SELECT 1 FROM (
					SELECT ModuleRightsId FROM Sys_Rights WHERE EXISTS(
						#用户直接配置权限
						SELECT 1 FROM Sys_UserRoleRelationShips AS SHIP WHERE SHIP.UserId=UserId AND SHIP.RoleId=Sys_Rights.RoleId
					)
					OR EXISTS(
						#通过员工配置岗位权限
						SELECT 1 FROM HR_PositionRoleRelationShips AS SHIP 
						INNER JOIN Hr_DepartmentPosition AS DP ON SHIP.PositionID=DP.PositionId
						INNER JOIN Hr_Employee AS EMP ON DP.Id=EMP.DepartmentPositionId
						WHERE SHIP.RoleId=Sys_Rights.RoleId AND EMP.UserId=UserId						
					)
				) AS RS 
				INNER JOIN Sys_ModuleRights AS R ON RS.ModuleRightsId = R.Id
				INNER JOIN Sys_Module AS M ON R.ModuleId = M.Id
				INNER JOIN Sys_ModuleGroup AS G ON M.GroupId=G.ID    
				WHERE  G.DelFlag=0 AND G.DataStatus=1 AND M.DelFlag=0 AND M.DataStatus=1		
					AND SUBSTRING(G.VisitPath,1,SelectPathLength) = MG.VisitPath			 
					AND  R.RightType=1
				)
			ORDER BY VisitPath;  
	END IF;  
end
 ;;
delimiter ;

-- ----------------------------
--  Procedure structure for `up_Sys_GetModules`
-- ----------------------------
DROP PROCEDURE IF EXISTS `up_Sys_GetModules`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `up_Sys_GetModules`(IN UserId varchar(50), IN GroupId varchar(50), IN IsSupperAdmin bit)
BEGIN

	DECLARE SelectPathLength INT; 
	 
	#超级管理员
	IF IsSupperAdmin=1
	THEN  
		#所有当前可以访问的模块列表
		SELECT * FROM Sys_Module AS M 
		WHERE M.DelFlag=0 AND M.DataStatus=1 AND M.GroupId=GroupId
		ORDER BY DataSort; 
	ELSE   
		 SELECT * FROM Sys_Module AS M
		 WHERE M.DataStatus=1 AND M.DelFlag=0 AND M.GroupId=GroupId
			AND EXISTS(  
				#所有当前可以访问的模块列表
				SELECT 1 FROM  Sys_ModuleRights AS R 
				INNER JOIN Sys_Module AS M ON R.ModuleId = M.Id 
				WHERE R.RightType=0 AND M.DelFlag=0 AND M.DataStatus=1  
			
				UNION ALL
				#RightType=1 可分配
				#当前角色有的权限
				#有效性过滤（要求未删除且正在使用的才能计算）
				SELECT 1 FROM (
					SELECT ModuleRightsId FROM Sys_Rights WHERE EXISTS(
						#用户直接配置权限
						SELECT 1 FROM Sys_UserRoleRelationShips AS SHIP WHERE SHIP.UserId=UserId AND SHIP.RoleId=Sys_Rights.RoleId
					)
					OR EXISTS(
						#通过员工配置岗位权限
						SELECT 1 FROM HR_PositionRoleRelationShips AS SHIP 
						INNER JOIN Hr_DepartmentPosition AS DP ON SHIP.PositionID=DP.PositionId
						INNER JOIN Hr_Employee AS EMP ON DP.Id=EMP.DepartmentPositionId
						WHERE SHIP.RoleId=Sys_Rights.RoleId AND EMP.UserId=UserId						
					)
				) AS RS 
				INNER JOIN Sys_ModuleRights AS R ON RS.ModuleRightsId = R.Id 
				WHERE M.DelFlag=0 AND M.DataStatus=1	  
					AND R.RightType=1 AND R.ModuleId = M.Id 
				)
			ORDER BY DataSort,Id;  
	END IF; 
END
 ;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
